INSERT INTO `otk_about` VALUES ('1', '四志国际教育-Sage Education', '0', '<p class=\"MsoNormal\">\r\n	<strong><span style=\"color:#000000;\">深圳市四志国际教育有限公司是由在教育领域拥有丰富教学经验的资深教师团队共同创立的培训机构。本机构致力于中小学各科专业辅导及其它特长培训，长年开设中小学语.数.理.化.英专业辅导班和晚托班，另设有少儿英语口语等课程。</span></strong>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<strong><span style=\"color:#000000;\">&nbsp;</span></strong>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<strong><span style=\"color:#000000;\">&nbsp;</span></strong>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<strong><span style=\"color:#000000;\">Shenzhen Sage Education&nbsp;Co.,Ltd.is established by a group of excellent teachers with rich teaching experience &nbsp;in the field&nbsp;of education.</span></strong>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<strong><span style=\"color:#000000;\">We devote to help the students improve their study and get a better grade!We also offer spoken English&nbsp;&nbsp;training courses for children.</span></strong>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<strong><span style=\"color:#000000;\">&nbsp;</span></strong>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	&nbsp;\r\n</p>', '1456391405', '');
