INSERT INTO `otk_jt_about` VALUES ('14', '关于博佳', '1', '1', '湖南博佳文化传播有限公司（以下简称博佳传媒）是博胜集团旗下公司，是一家致力于电视、电影、自制剧等内容生产、推广服务的公司。公司目前主要提供以下服务：栏目、综艺、电视剧、电影等网络推广、话题营造、纸媒营销、APP定制、社会化媒体营销及下线活动内容等业务。<br />\r\n服务案例：<br />\r\n湖南卫视：爸爸去哪儿，一年级，奇妙的朋友，花儿与少年。古剑奇谭，风中奇缘，活色生香，少年四大名铺，不一样的美男子，爱你万缕千丝。<br />\r\n其他卫视：江西卫视带着爸妈去旅行、云南卫视勇者奇兵、舞动全城、湖北卫视如果爱、一起出发、安徽卫视医馆笑传等。', '5', '1435138229', '');
INSERT INTO `otk_jt_about` VALUES ('15', '关于我们', '0', '1', '<div class=\"hp-contentext\">\r\n	<p>\r\n		博胜互动由三个创始人<span>2009</span>年成立至今，形成以点带面，辐射全国的服务网络，成为国内最具实效的专业网络营销公司。为客户提供的服务以互联网平台的应用为核心，逐步涵盖手机、电视、报纸、电台、户外等多元化传播领域的综合营销服务体系，将客户的推广价值最大化。博胜互动经过多年的细心经营，博胜互动形成了以<span>“</span>热衷于挑战，沉醉于创新<span>”</span>的企业文化。人，是博胜互动的第一资本。<span>“</span>以人为本<span>”</span>的博胜互动吸纳了国内资深的互联网营销及广告传媒界的专业人士，坚持为客户提供最真实、有效的互联网营销服务\r\n	</p>\r\n	<p>\r\n		<br />\r\n	</p>\r\n</div>', '3', '1435456536', '关于我们');
INSERT INTO `otk_jt_about` VALUES ('16', '博胜信息科技（广州）有限公司 成立于2007年', '0', '1', '<p class=\"MsoNormal\" style=\"text-align:left;\">\r\n	广州博胜信息科技有限公司（以下简称博胜科技）是博胜集团旗下公司，成立于2011年，专注于互联网以及移动互联网领域，为客户提供专业的社会化资产服务，如精准营销、PR、Social、Media、数字营销、电子商务、电视网络营销等；公司秉承“真实有效”的客户服务标准，并与新浪微博、百度贴吧、腾讯互娱建立长期稳定的战略合作，为客户提供社会化资产服务，使客户的品牌推广价值最大化。，&nbsp;<br />\r\n公司服务主要客户：中国移动、中国电信、华为、加多宝、昆仑山、康佳、中粮、金龙鱼、WIS、新居、绝味、爱尔眼科等。<span style=\"line-height:1.5;\"></span> \r\n</p>', '2', '1449756591', '博胜科技关于我们');
INSERT INTO `otk_jt_about` VALUES ('17', '关于我们', '0', '1', '<p class=\"MsoNormal\">\r\n	博胜电子商务（长沙）有限公司（以下简称博胜电商）成立于2011年3月，隶属博胜集团，2011年11月1日正式注册，注册资金100万元，是一家为品牌企业和零售商提供包括营销策划、设计创意、用户研究、客服服务、数据分析等在内的专业的整合式电子商务服务商。经过二年的不断发展与学习成为湖南电子商务第三方外包服务行业领军者。以“服务至上、发展共赢”为基本形态，现成立了以长沙为总部运营，以湖南省为重点商家合作基地，全面整合线上与线下的资源，在专注本地市场开辟的同时，以“区域化电子商务第三方服务+专项服务”的运营模式，为客户提供精细化、专业化、个性化的外包服务。\r\n</p>', '4', '1449924907', '');
