INSERT INTO `otk_teacher` VALUES ('6', '陈老师', '1', '/Uploads/Picture/570a72802d50b.png', '', '', '0', '', '给学生一片蓝天，他们会让它繁星点点。给学生一片绿地，他们会让它春色满园', '4', '1460302826', '0', '', '0755-36312340', '', '', '');
INSERT INTO `otk_teacher` VALUES ('7', '秦老师', '8', '/Uploads/Picture/570a793cce9e7.png', '', '', '0', '', 'Come on ! Never give up! Never say stop! I can .I can .I can be the NO.1 !\r\n\r\n教师描述：学校在职英语教师', '5', '1460304217', '2', '', '18475616429', '', '', '');
INSERT INTO `otk_teacher` VALUES ('8', '方老师', '8', '/Uploads/Picture/570a86cf37bb4.png', '', '', '0', '', '教师描述：毕业于湖北师范大学；学校在职教学组长。\r\n教学理念：不为失败找借口只为成功找出路。', '9', '1460307708', '2', '', '18475616429', '', '', '');
INSERT INTO `otk_teacher` VALUES ('9', '董老师', '1', '/Uploads/Picture/570a875691735.png', '', '', '0', '', '我坚信每个孩子都是一粒种子，我愿把自己的热情和爱化作一缕阳光，不断提高自己人格的魅力，丰盈自己生命底色，为孩子的成长提供甘甜的雨露和肥沃的土壤，使每一粒种子都能充满勃勃的生机。\r\n\r\n教师描述：学校在职数学教师。', '5', '1460307802', '0', '', '18475616429', '', '', '');
INSERT INTO `otk_teacher` VALUES ('10', '外教Gretchen', '1', '/Uploads/Picture/57ef4c118246c.png', '', '', '0', '', 'Never give up！永不放弃！', '5', '1460560816', '2', '', '18475616429', '', '', '');
INSERT INTO `otk_teacher` VALUES ('12', '曾老师', '1', '/Uploads/Picture/5717952d128d4.png', '', '', '0', '', '好方法事半功倍，好习惯收益终生。', '4', '1461163396', '10', '', null, '', null, null);
INSERT INTO `otk_teacher` VALUES ('13', '张雪琴', '4', '/Uploads/Picture/577236811fc85.png', '', '', '0', '', '毕业于韶关学院，在校获得多个荣誉奖项，亲和力强', '3', '1467103040', '3', '', '18475616429', '', '', '');
INSERT INTO `otk_teacher` VALUES ('14', '胡栋梅', '4', '/Uploads/Picture/5772a5fa9777d.png', '', '', '0', '', '毕业于贵州音乐学院，主修钢琴副修古筝，现担任国际古筝协会会员，中国民族器乐学会委员，深圳市音乐协会会员，上海音乐学院深圳考区优秀导师，青年古筝演奏家、教育家。', '15', '1467103525', '2', '', '18475616429', '', '', '');
INSERT INTO `otk_teacher` VALUES ('15', '张胜祥', '4', '/Uploads/Picture/57723a2a8e949.png', '', '', '0', '', '亚洲钢琴协会钢琴家、国际高级考官，中国艺术家协会会员，深圳市音乐协会会员。', '16', '1467103870', '0', '', '18475616429', '', '', '');
INSERT INTO `otk_teacher` VALUES ('16', '张彪军', '5', '/Uploads/Picture/579174b2bf5b5.png', '', '', '0', '', '段位：香港跆拳道正道馆黑带一段、中国跆拳道协会黑带二段、深圳市跆拳道协会黑带三段。\r\n\r\n荣誉：2009年荣获惠州市“北极杯”跆拳道精英赛男子55kg组第三名、2010年荣获“中国跆拳道全国优秀学员”、2012年荣获龙岗区“跆拳道交流赛”男子56kg组第二名。2013年荣获深圳市“跆拳道锦标赛”男子成人56kg组第三名。', '7', '1469150492', '2', '', '0755-33560953', '', '', '');
INSERT INTO `otk_teacher` VALUES ('17', '黄梓杰', '5', '/Uploads/Picture/5791755c2a2a8.png', '', '', '0', '', '2013年毕业于汕头文化艺术学校国标系 舞龄12年 有着6年的舞蹈教学经验\r\n2012年荣获贵州省国际标准舞锦标赛 业余组   冠军\r\n      荣获广东省第20届国际标准舞锦标赛 普通高校组   冠军\r\n2013年代表汕头市参加广东省第三届体育舞蹈大赛   获得冠军\r\n2013年荣获首届粤东“乐观杯” 国际标准舞公开赛  专业院校A组  冠军\r\n      荣获首届粤东“乐观杯” 国际标准舞公开赛  专业院校B组  亚军\r\n      荣获首届粤东“乐观杯” 国际标准舞公开赛  职业组      第六名\r\n      荣获首届粤东“乐观杯” 国际标准舞公开赛  团体舞表演   冠军\r\n2014年荣获汕头市首届“粤龙杯”国际标准舞公开赛 专业院校B组 冠军\r\n      荣获汕头市首届“粤龙杯”国际标准舞公开赛 专业院校A组 亚军\r\n2015年受邀前往北京录制湖北卫视（我爱我的祖国）\r\n有着多年的演出教学经验  收到各界人士一致好评', '6', '1469150560', '1', '', '0755-33560953', '', '', '');
INSERT INTO `otk_teacher` VALUES ('18', '蔡希意', '6', '/Uploads/Picture/579f47d165f69.png', '', '', '0', '', '1999年毕业于中国书画函授大学，擅长花鸟画及山水画，书法等。\r\n现为东坡艺术研究院院士，中国书画艺术研究会会员，中国当代书画艺术研究会理事，中国书画家协会会员。', '16', '1470056637', '1', 'oEjhSwkPDVqPNjaOOc4B1EzwxC4Y', '18475616429,   ', '', '', '');
INSERT INTO `otk_teacher` VALUES ('19', '彭苏琼', '5', '/Uploads/Picture/57b2b102c50a8.png', '', '', '0', '', '毕业于广东省第二师范学院学前教育专业，大专学历。荣获中国舞考级教师资格证书，全国爵士舞等级考试教师资格证书，幼儿教师资格证书。曾担任爱贝儿幼儿园专科舞蹈教师，组织学生在多次六.一比赛中荣获优异成绩，所辅导的舞蹈《艺彩飞扬》在东莞市大朗第五届少儿才艺大赛中幼儿群体组荣获银奖，个人荣获金奖，多次被评为大朗优秀辅导教师。\r\n参加工作以来，一直从事少儿舞蹈课程教学，在教学过程中因材施教，严谨的工作态度以及极强的亲和力，受到了学生和家长的一致好评。', '4', '1471328564', '1', '', '0755-33560953', '', '', '');
INSERT INTO `otk_teacher` VALUES ('20', '梁温', '7', '/Uploads/Picture/57d79595ab1c4.png', '', '', '0', '', '专业：广西玉林师范学院物理专业\r\n教学风格：灵活多变创新独特\r\n工作经验：曾在广西大理镇中学担任过多年的初中物理教师，现任深圳某学校初中物理老师。在教育领域拥有十几年的专业中小学一对一数理化辅导经验，帮助过许多学生考上了他们理想的重点学校!', '12', '1473745917', '1', '', '18475616429', '', '', '');
INSERT INTO `otk_teacher` VALUES ('21', '王东伟', '7', '/Uploads/Picture/57df748e7d5d2.png', '', '', '0', '', ' 2004毕业于专业师范学院，2005年来深圳任教至今。曾获龙岗区优秀班主任、多次获街道  优秀班主任、优秀辅导员、优秀教师、优秀安全工作者等称号。常期代初中数学 ，有着独特的教学方法及创新思维，所教年级在街道稳定一、二、三名。', '13', '1474262183', '1', '', '', '', '', '');
INSERT INTO `otk_teacher` VALUES ('22', '廖桂清', '8', '/Uploads/Picture/583066b6465d4.png', '', '', '0', '', '毕业于广东教育学院，汉语语言文学，拥有21年的教学经验', '21', '1479567034', '0', '', '18475616429', '', '', '');
