  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '设置ID',
  `type` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '配置类型（1-用户配置）',
  `value` text NOT NULL COMMENT '配置数据',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='设置表';

-- ----------------------------
-- Records of otk_ucenter_setting
-- ----------------------------

-- ----------------------------
-- Table structure for `otk_url`
-- ----------------------------
DROP TABLE IF EXISTS `otk_url`;
CREATE TABLE `otk_url` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '链接唯一标识',
  `url` char(255) NOT NULL DEFAULT '' COMMENT '链接地址',
  `short` char(100) NOT NULL DEFAULT '' COMMENT '短网址',
  `status` tinyint(2) NOT NULL DEFAULT '2' COMMENT '状态',
  `create_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `idx_url` (`url`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='链接表';

-- ----------------------------
-- Records of otk_url
-- ----------------------------

-- ----------------------------
-- Table structure for `otk_userdata`
-- ----------------------------
DROP TABLE IF EXISTS `otk_userdata`;
CREATE TABLE `otk_userdata` (
  `uid` int(10) unsigned NOT NULL COMMENT '用户id',
  `type` tinyint(3) unsigned NOT NULL COMMENT '类型标识',
  `target_id` int(10) unsigned NOT NULL COMMENT '目标id',
  UNIQUE KEY `uid` (`uid`,`type`,`target_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of otk_userdata
-- ----------------------------

-- ----------------------------
-- Table structure for `otk_week`
-- ----------------------------
DROP TABLE IF EXISTS `otk_week`;
CREATE TABLE `otk_week` (
  `id` int(255) unsigned NOT NULL AUTO_INCREMENT,
  `week_id` int(10) DEFAULT NULL COMMENT '星期id，0为星期日',
  `week_name` varchar(20) DEFAULT NULL,
  `week_sort` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `week_id` (`week_id`)
) ENGINE=MyISAM AUTO_INCREMENT=8 DEFAULT CHARSET=utf8;

