DROP TABLE IF EXISTS `otk_wx_callback_log`;
CREATE TABLE `otk_wx_callback_log` (
  `id` int(255) NOT NULL AUTO_INCREMENT,
  `ord_id` varchar(255) DEFAULT NULL,
  `logMessage` varchar(255) DEFAULT NULL,
  `addTime` int(50) DEFAULT NULL,
  `openid` varchar(150) DEFAULT NULL,
  `payStatus` varchar(5) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=80 DEFAULT CHARSET=utf8;

