-- ----------------------------
-- Table structure for `otk_wx_user`
-- ----------------------------
DROP TABLE IF EXISTS `otk_wx_user`;
CREATE TABLE `otk_wx_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `pwx_id` varchar(60) NOT NULL DEFAULT '0' COMMENT '父级微信id',
  `wx_id` varchar(60) NOT NULL COMMENT '微信ID',
  `wx_username` varchar(255) NOT NULL COMMENT '微信名称',
  `token` varchar(60) NOT NULL COMMENT 'token',
  `sex` int(2) NOT NULL COMMENT '性别',
  `city` varchar(60) NOT NULL COMMENT '城市',
  `province` varchar(60) NOT NULL COMMENT '省份',
  `country` varchar(60) NOT NULL COMMENT '国家',
  `language` varchar(60) NOT NULL COMMENT '语言',
  `nick_name` varchar(100) DEFAULT NULL COMMENT '昵称',
  `subscribe_time` int(11) NOT NULL COMMENT '关注时间',
  `tel` varchar(20) NOT NULL COMMENT '电话号码',
  `address` varchar(255) DEFAULT NULL COMMENT '地址',
  `user_name` varchar(60) DEFAULT NULL COMMENT '用户名',
  `level` int(11) NOT NULL DEFAULT '1' COMMENT '会员等级',
  `integral` int(11) NOT NULL DEFAULT '0' COMMENT '会员积分',
  `pic` varchar(255) NOT NULL COMMENT '头像',
  `contact` varchar(20) NOT NULL DEFAULT '' COMMENT '联系方式',
  `school` varchar(60) NOT NULL DEFAULT '' COMMENT '学校名',
  `class` varchar(255) NOT NULL DEFAULT '' COMMENT '班级',
  `agent_id` int(11) DEFAULT NULL COMMENT '代理商id',
  PRIMARY KEY (`id`),
  KEY `token` (`token`)
) ENGINE=InnoDB AUTO_INCREMENT=377 DEFAULT CHARSET=utf8 COMMENT='微信用户信息';

-- ----------------------------
-- Records of otk_wx_user
-- ----------------------------


